(49174, '24C5C7D3-BF99-4598-8DBD-8B80D421AA47', 'Thank you for giving me the space this weekend to go on my adventure….felt good to both do something for a cause, push out of my comfort zone…and meet new  people and be in nature. I was only a little bit bummed that you couldn’t do it with me! ', 'David', 'Nitzan', '2022-05-23T08:37:26.418669'),
(49175, 'DE6144EF-D05D-450D-8775-1A60D4399BB7', 'I too want to grow old and have many adventures with you! ', 'David', 'Nitzan', '2022-05-23T08:38:31.512793'),
(49180, 'D3CECAAB-45CD-48A8-991C-87FE84BF8AB1', 'Yes, I️ know you got it. That’s why I️ was apologizing. I️ could see on your face that it annoyed you that I️ was reminding you. ', 'Nitzan', 'David', '2022-05-23T08:40:25.960974'),
(49181, 'F4142F21-0E96-41DB-A936-BEEC650F9455', 'And thanks for acknowledging my role in this weekend in giving you space. I️ appreciate it a lot. And it’s my pleasure to give you the space to have new adventures!! I️ know how important they are to our growth as humans. So very glad you got the opportunity! ', 'Nitzan', 'David', '2022-05-23T08:41:29.147580'),
