(49222, 'F1865156-08B3-4137-BAA9-48278108B02E', 'Two scheduling things - I️’d like to have dinner with kate while you’re at mankind project this Thursday. There’s a bunch of unfinished stuff for us and she asked if we can do dinner on Thursday. I️’m going to ask Lima if she can pick Orli up from HOH. Hopefully she can. It also looks like the mamas are organizing a baby shower for Yael next Wednesday. Yael goes to sleep super early so it’s going to be at 5:30pm. Her baby comes in early July.', 'Nitzan', 'David', '2022-05-24T09:28:07.264197'),
(49223, '0B571E56-AA6D-4B18-9FDF-7116314D27B2', 'Lastly, I️’m hoping we’ll get some time with Dan and sarah this weekend. They leave on Monday and so I️’m hoping they either want to do Shabbat with us or maybe hang on Sunday. We don’t have a ton of plans this weekend, but wanted to check in about all these things with you', 'Nitzan', 'David', '2022-05-24T09:29:15.350288'),
(49224, '0680A861-8E3E-417F-AE60-913C1322C8A6', 'On the emotional side, I️’m not sure why I️’m a bath of tears this morning but I️ can’t stop crying and just feel so very sad. I️ am deeply unmoored when we aren’t solid, and even more so when we are unkind to each other. My therapist gave me some ideas for things to chat about with Priscilla later this week to potentially help with some of this. I️ know you are in pain too and I️’m sad for you as well.', 'Nitzan', 'David', '2022-05-24T09:30:44.980209'),
